// Jumbo.js
import React, { Component, Img } from 'react';
import { Card, Badge, Row, Col, Button, Menu, Icon, Layout } from 'antd';

let imgUrl = './imgs/yo.png';
let styles = {
  root: {
    background: 'url('+ imgUrl + ') noRepeat center center fixed',
    backgroundSize: 'cover',
    overflow: 'hidden'
  }
}

class Jumbo extends Component {
  render () {
    <div style={styles}>
      <Img src={imgUrl}/>
    </div>
  }
}

export default Jumbo;
